import React, { Component } from 'react';
import './App.css';
import Person from './Person/Person';

class App extends Component {
  state = {
    persons: [
      { name: 'Dante', visit: 3 },
      { name: 'Chun', visit: 5 },
      { name: 'Felyne', visit: 7 },
    ],
  };
  render() {
    return (
      <div className='App'>
        <h1>Hi, I'm a React App</h1>
        <button>Switch Button</button>
        <Person name={this.state.persons[0].name} visit='3' />
        <Person name='Ryu' visit='2' />
        <Person name='Wesker' visit='1'>
          Color: Black
        </Person>
      </div>
    );
  }
}

export default App;
